webpackJsonp([0xa2e23d4777ab],{1435:function(a,e){a.exports={data:{markdownRemark:{html:'<p>本を買うためにセントラルパーティスクールに行くと、そこに書店は小さくない、100元以上の本を買った、サミュエルソンの "経済学"第12版、 "将来の社会主義"と他の本があります。古代インドの哲学書「Shun Shi」は、彼らがどのように問題を考えているのか、そして論理と哲学の違いは何かを見たいと思っています。インドの哲学が問題を考える方法は全く異なります。 Maughamの斬新なBladeは、インドの哲学の影響を大きく受けています。</p>\n<p>すべての人が幹部賃金が低すぎるという問題について話しました。この場合、中国の経営陣はうまく行かず、社会の最高の才能がどこに行くのでしょうか。良質の仕組みがなければ、優秀な人材は国家と政党の経営拠点に流れないので、長期的には中核経営になります。問題が発生します。これは戦略的な問題です。</p>',id:"/home/swain/workspace/political-life/src/pages/ja/0083.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0083.md",frontmatter:{title:"4月28日 木曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0083.md absPath of file >>> MarkdownRemark"}}}});
